# start with left = 0, iterate right across the nums

# have a mid go to the last 1 in the window
# the length of mid - left + 1 is the number of subarrays 

def numSubarraysWithSum(nums, goal):
    # if goal == 0 and sum(nums) == 0: 
    #     n = len(nums)
    #     return int(n*(n+1) / 2)
    left = 0
    mid = 0
    wSum = 0
    numSubarrays = 0
    for i, right in enumerate(nums):
        if right == 1: wSum += 1

        #move mid to the last 1 in the window  
        if wSum >= goal: 
            while wSum > goal: 
                if nums[left] == 1: wSum -= 1
                left += 1
            mid = left
            # move mid to the first 1, which is the end of the window towards the left
            while mid < len(nums) and nums[mid] != 1 and mid < i: 
                mid += 1

            if left <= mid <= i:
                numSubarrays += mid - left + 1

    return numSubarrays 


# another way to write this: 

def numSubarraysWithSum1(nums, goal):

    # calculate subarrays with at most Goal
    def atMost(goal):
        if goal < 0: return 0
        j, res = 0, 0
        for i in range(len(nums)):
            goal -= nums[i]
            while goal < 0: 
                goal += nums[j]
                j += 1

            res += i - j + 1
        return res

    return atMost(goal) - atMost(goal - 1)

